/// data : {"videoId":"05b4529c-661d-363f-9ff1-51cf551080cd","title":"火影忍者","descs":"　　十多年前一只拥有巨大威力的妖兽“九尾妖狐”袭击了木叶忍者村，当时的第四代火影拼尽全力，以自己的生命为代价将“九尾妖狐”封印在了刚出生的鸣人身上。木叶村终于恢复了平静，但村民们却把鸣人当成像“九尾妖狐”那样的怪物看待，所有人都疏远他。鸣人自小就孤苦无依，一晃十多年过去了，少年鸣人考入了木叶村的忍者学校，结识了好朋友佐助和小樱。佐助是宇智波家族的传人之一，当他还是小孩的时候他的哥哥——一个已经拥有高超忍术的忍者将他们家族的人都杀死了，然后投靠了一直想将木叶村毁灭的大蛇丸，佐助自小就发誓要超越哥哥，为家族报仇。鸣人他们在忍者学校得到了教官卡卡西的精心指点，在他的帮助下去迎接成长中的一次又一次挑战！","cover":"http://api.pingcc.cn/video/img/火影忍者/火影忍者.jpg","director":"伊达勇登,村田雅彦,都留稔幸,若林厚史,小坂春女,川口敬一郎","actor":"竹内顺子,杉山纪彰,中村千绘,井上和彦,关俊彦,松本和香子,大塚芳忠,胜生真沙子,柴田秀胜,森久保祥太郎,伊藤健太郎,柚木凉香,小杉十郎太,增川洋一,远近孝一,田村由香里,江原正士,水树奈奈,鸟海浩辅,川田绅司,落合露美,大谷育江,重松朋,下屋则子,飞田展男,石冢运升,浅野真由美,石田彰,加濑康之,朴璐美,中田让治,保志总一朗,神奈延年,三木真一郎,中村大树,家中宏,福田信昭,楠大典,本田贵子,平田广明,津田健次郎,坪井智浩,河野智之,根本圭子,铃木琢磨,小林由美子,津田英三,伊藤和晃,浅井清己,佐佐木望","region":"日本","videoType":"日韩动漫,","releaseTime":"2002","updateTime":"2022-08-20","chapterList":[{"title":"第01集","chapterPath":"https://vip.lz-cdn6.com/20220819/23119_06404026/index.m3u8"},{"title":"第02集","chapterPath":"https://vip.lz-cdn.com/20220818/28712_255494a9/index.m3u8"},{"title":"第03集","chapterPath":"https://vip.lz-cdn.com/20220818/28713_5eda6afd/index.m3u8"},{"title":"第04集","chapterPath":"https://vip.lz-cdn.com/20220818/28714_f445888b/index.m3u8"},{"title":"第05集","chapterPath":"https://vip.lz-cdn.com/20220818/28715_07c633b7/index.m3u8"},{"title":"第06集","chapterPath":"https://vip.lz-cdn.com/20220818/28716_12588702/index.m3u8"},{"title":"第07集","chapterPath":"https://vip.lz-cdn.com/20220818/28717_5d6f17c8/index.m3u8"},{"title":"第08集","chapterPath":"https://vip.lz-cdn.com/20220818/28718_9f028d81/index.m3u8"},{"title":"第09集","chapterPath":"https://vip.lz-cdn.com/20220818/28719_4105995f/index.m3u8"},{"title":"第10集","chapterPath":"https://vip.lz-cdn.com/20220818/28720_43c09e9f/index.m3u8"},{"title":"第11集","chapterPath":"https://vip.lz-cdn.com/20220818/28721_8afeb247/index.m3u8"},{"title":"第12集","chapterPath":"https://vip.lz-cdn.com/20220818/28722_1a9355ee/index.m3u8"},{"title":"第13集","chapterPath":"https://vip.lz-cdn.com/2022