    _cover = json['cover'];
    _director = json['director'];
    _actor = json['actor'];
    _region = json['region'];
    _videoType = json['videoType'];
    _releaseTime = json['releaseTime'];
    _updateTime = json['updateTime'];
    if (json['chapterList'] != null) {
      _chapterList = [];
      json['chapterList'].forEach((v) {
        _chapterList?.add(ChapterList.fromJson(v));
      });
    }
  }
